import React, { Component } from 'react'
import Layout from '../../Components/Layout'
import {Link} from '../'

class newCandidate extends Component{
    render(){
        return(
            <Layout>
                <Link route = '/'>
                    <a>
                        Homepage
                    </a>
                </Link>
                <h3>Here we create Candidates</h3>
            </Layout>
        )
    }
}

export default newCandidate
